import React, {useState} from 'react'

const Practice = () => {
    const [text, setText] = useState({})
    const [stuff, setStuff] = useState([])

    const onChange = ({target}) => {
        setText({
            [target.name]: target.value,
            key: Date.now()
        })
    }

    const onSubmit = (e) => {
        e.preventDefault();
        console.log(text);
        setStuff(prev => [...prev, text])
    }

    return (
        <form onSubmit={onSubmit}>
            <label>Enter something</label>
            <br/>
                <input onChange={onChange} type='first' name='first'  /> 
                <input onChange={onChange} type='last' name='last'  /> 
            <br/>
            <input value='Submit' type='submit' name='sumbit' />
            <div>
                {stuff.map((item) => <h1 key={item.key}>{item.first}{item.last}</h1>)}
            </div>
        </form>
    )
}

export default Practice
